INSERT INTO `food_knowledge` VALUES (1, '为什么睡眠不足可能导致体重增加？', '因为晚上容易饿，会吃更多。', '因为睡眠不足会干扰身体的激素平衡，增加饥饿感，减少饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (2, '哪种类型的脂肪对减肥最有益？', '所有类型的脂肪都对减肥有害。', '不饱和脂肪，如橄榄油、坚果和鱼类中的Omega-3脂肪酸，对心脏健康有益，并且可以促进减肥。', 0);
INSERT INTO `food_knowledge` VALUES (3, '为什么喝水可以帮助减肥？', '因为喝水可以填饱肚子，减少食物摄入。', '喝水有助于提高新陈代谢率，并且可以增加饱腹感，减少食物的摄入量。', 0);
INSERT INTO `food_knowledge` VALUES (4, '为什么吃辣椒可能有助于减肥？', '辣椒含有的辣椒素可以燃烧脂肪。', '辣椒含有的辣椒素可以提高身体的代谢率，并且可以暂时增加能量消耗。', 0);
INSERT INTO `food_knowledge` VALUES (5, '为什么减肥时不建议频繁称体重？', '因为体重的小幅波动会打击减肥的积极性。', '体重的小幅波动可能是水分和食物摄入的正常变化，频繁称重可能导致过度关注短期结果，而忽视长期的健康和生活方式改变。', 1);
INSERT INTO `food_knowledge` VALUES (6, '为什么高强度间歇训练（HIIT）被认为对减肥有效？', '因为它可以在短时间内燃烧更多的卡路里。', 'HIIT不仅可以在运动期间燃烧卡路里，还能在运动后通过增加身体的基础代谢率继续燃烧卡路里，这种现象被称为后燃效应。', 1);
INSERT INTO `food_knowledge` VALUES (7, '为什么减肥时应该避免饮用含糖饮料？', '因为它们含有高热量，容易导致体重增加。', '含糖饮料不仅含有高热量，而且会迅速提升血糖水平，导致胰岛素分泌增加，这会促进脂肪的储存，并且减少饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (8, '为什么减肥时应该增加蛋白质的摄入？', '因为蛋白质可以增加饱腹感，减少饥饿感。', '蛋白质不仅可以增加饱腹感，还有助于维持肌肉质量，肌肉组织比脂肪组织在静息状态下燃烧更多的卡路里。', 0);
INSERT INTO `food_knowledge` VALUES (9, '为什么减肥时不应该过分限制热量摄入？', '因为身体会进入饥饿模式，减缓新陈代谢。', '过分限制热量摄入可能导致营养不良，减缓新陈代谢，使减肥变得更加困难。同时，一旦恢复正常饮食，体重可能会迅速反弹。', 0);
INSERT INTO `food_knowledge` VALUES (10, '为什么睡眠对减肥很重要？', '因为睡眠可以帮助身体恢复，减少第二天的食欲。', '睡眠不仅帮助身体恢复，还对调节食欲和能量平衡的激素有重要影响。睡眠不足可能导致食欲增加，减少饱腹感，从而影响减肥效果。', 1);
INSERT INTO `food_knowledge` VALUES (11, '为什么减肥时早餐很重要？', '因为早餐是一天中唯一的一餐，可以随意吃。', '早餐可以帮助启动新陈代谢，避免因长时间不进食导致的过度饥饿和随后的暴饮暴食。', 1);
INSERT INTO `food_knowledge` VALUES (12, '为什么减肥时应该避免空腹运动？', '空腹运动可以燃烧更多的脂肪。', '空腹运动可能降低运动表现，增加受伤风险，并且可能导致肌肉分解，不利于长期减肥和健康。', 0);
INSERT INTO `food_knowledge` VALUES (13, '为什么减肥时不应该完全避免脂肪摄入？', '因为脂肪是高热量食物，可以帮助快速减重。', '健康的脂肪，如坚果、鱼类和橄榄油中的脂肪，对维持身体功能和吸收某些维生素至关重要，并且有助于控制饥饿感。', 0);
INSERT INTO `food_knowledge` VALUES (14, '为什么减肥时不应该完全避免碳水化合物？', '因为碳水化合物是身体的主要能量来源，不吃会导致能量不足。', '完全避免碳水化合物可能导致身体缺乏必要的营养，影响健康，并且长期来看不利于持续减肥。', 0);
INSERT INTO `food_knowledge` VALUES (15, '为什么减肥时推荐食用全谷物而不是精制谷物？', '全谷物比精制谷物含有更多的糖分。', '全谷物富含纤维，有助于提高饱腹感，同时提供更持久的能量，有助于控制体重。', 1);
INSERT INTO `food_knowledge` VALUES (16, '为什么减肥时应该关注食物的质量而不仅仅是数量？', '因为食物的质量不会影响体重。', '食物的质量直接影响营养摄入和健康，选择营养密度高的食物有助于减肥同时保持健康。', 0);
INSERT INTO `food_knowledge` VALUES (17, '为什么减肥时建议多摄入膳食纤维？', '膳食纤维会增加热量摄入。', '膳食纤维有助于提高饱腹感，促进肠道健康，并且有助于控制血糖水平，对减肥有积极作用。', 1);
INSERT INTO `food_knowledge` VALUES (18, '为什么减肥时不应该依赖快速减肥方案？', '快速减肥方案可以帮助快速减重。', '快速减肥方案往往不可持续，可能导致营养不良和体重反弹，不利于长期健康。', 0);
INSERT INTO `food_knowledge` VALUES (19, '为什么减肥时推荐增加日常活动量而不是只依赖健身房锻炼？', '因为日常活动消耗的热量远大于健身房锻炼。', '日常活动可以增加非运动性热量消耗，有助于提高整体代谢率，对减肥有积极作用。', 1);
INSERT INTO `food_knowledge` VALUES (20, '为什么减肥时应该避免饮用含糖饮料和酒精饮料？', '因为这些饮料含有的热量很低。', '含糖饮料和酒精饮料含有空热量，不提供必要的营养，并且可能导致能量过剩和体重增加。', 1);
INSERT INTO `food_knowledge` VALUES (21, '为什么减肥时推荐多摄入富含蛋白质的食物？', '因为蛋白质会增加体重。', '蛋白质有助于增加饱腹感，减少总热量摄入，并且有助于肌肉修复和增长。', 0);
INSERT INTO `food_knowledge` VALUES (22, '为什么减肥时应该减少盐分摄入？', '盐分摄入与体重无关。', '高盐分摄入可能导致水肿，增加体重，并且可能增加对高热量食物的渴望。', 0);
INSERT INTO `food_knowledge` VALUES (23, '为什么减肥时推荐食用富含纤维的食物？', '纤维会增加热量摄入。', '纤维有助于增加饱腹感，减少食物摄入，并且有助于维持血糖稳定。', 0);
INSERT INTO `food_knowledge` VALUES (24, '为什么减肥时应该避免饮用含糖饮料？', '偶尔饮用含糖饮料对减肥影响不大。', '含糖饮料含有高量空热量，不提供饱腹感，并且可能导致总热量摄入过多。', 0);
INSERT INTO `food_knowledge` VALUES (25, '为什么减肥时应该避免长时间低热量饮食？', '低热量饮食可以帮助快速减重。', '长时间低热量饮食可能导致新陈代谢减缓，肌肉流失，并且一旦恢复正常饮食体重容易反弹。', 1);
INSERT INTO `food_knowledge` VALUES (26, '为什么减肥时推荐食用瘦肉而不是肥肉？', '瘦肉和肥肉的热量相同。', '瘦肉含有更少的脂肪和热量，同时提供必需的蛋白质，有助于维持肌肉量。', 1);
INSERT INTO `food_knowledge` VALUES (27, '为什么减肥时推荐进行有氧运动和力量训练的结合？', '力量训练对减肥没有帮助。', '有氧运动可以帮助燃烧热量，而力量训练有助于增加肌肉量，提高新陈代谢率。', 0);
INSERT INTO `food_knowledge` VALUES (28, '为什么减肥时应该避免吃快餐？', '快餐可以提供快速能量，有助于减肥。', '快餐通常高热量、高脂肪、高盐分，并且缺乏必要的营养素，不利于减肥。', 0);
INSERT INTO `food_knowledge` VALUES (29, '为什么减肥时应该保证充足的水分摄入？', '喝水会增加体重。', '充足的水分摄入有助于维持新陈代谢，排除体内毒素，并且有助于区分口渴和饥饿感。', 1);
INSERT INTO `food_knowledge` VALUES (30, '为什么减肥时应该避免饮酒？', '适量饮酒对减肥没有影响。', '酒精含有空热量，并且可能增加对高热量食物的渴望，影响减肥效果。', 0);
INSERT INTO `food_knowledge` VALUES (31, '为什么减肥时推荐多摄入富含蛋白质的食物？', '因为蛋白质会增加体重。', '蛋白质有助于增加饱腹感，减少总热量摄入，并且有助于肌肉修复和增长。', 1);
INSERT INTO `food_knowledge` VALUES (32, '为什么减肥时应该减少盐分摄入？', '盐分摄入与体重无关。', '高盐分摄入可能导致水肿，增加体重，并且可能增加对高热量食物的渴望。', 0);
INSERT INTO `food_knowledge` VALUES (33, '为什么减肥时推荐食用富含纤维的食物？', '纤维会增加热量摄入。', '纤维有助于增加饱腹感，减少食物摄入，并且有助于维持血糖稳定。', 0);
INSERT INTO `food_knowledge` VALUES (34, '为什么减肥时应该避免饮用含糖饮料？', '偶尔饮用含糖饮料对减肥影响不大。', '含糖饮料含有高量空热量，不提供饱腹感，并且可能导致总热量摄入过多。', 0);
INSERT INTO `food_knowledge` VALUES (35, '为什么减肥时应该避免长时间低热量饮食？', '低热量饮食可以帮助快速减重。', '长时间低热量饮食可能导致新陈代谢减缓，肌肉流失，并且一旦恢复正常饮食体重容易反弹。', 0);
INSERT INTO `food_knowledge` VALUES (36, '为什么减肥时推荐食用瘦肉而不是肥肉？', '瘦肉和肥肉的热量相同。', '瘦肉含有更少的脂肪和热量，同时提供必需的蛋白质，有助于维持肌肉量。', 1);
INSERT INTO `food_knowledge` VALUES (37, '为什么减肥时推荐进行有氧运动和力量训练的结合？', '力量训练对减肥没有帮助。', '有氧运动可以帮助燃烧热量，而力量训练有助于增加肌肉量，提高新陈代谢率。', 0);
INSERT INTO `food_knowledge` VALUES (38, '为什么减肥时应该避免吃快餐？', '快餐可以提供快速能量，有助于减肥。', '快餐通常高热量、高脂肪、高盐分，并且缺乏必要的营养素，不利于减肥。', 1);
INSERT INTO `food_knowledge` VALUES (39, '为什么减肥时应该保证充足的水分摄入？', '喝水会增加体重。', '充足的水分摄入有助于维持新陈代谢，排除体内毒素，并且有助于区分口渴和饥饿感。', 1);
INSERT INTO `food_knowledge` VALUES (40, '为什么减肥时应该避免饮酒？', '适量饮酒对减肥没有影响。', '酒精含有空热量，并且可能增加对高热量食物的渴望，影响减肥效果。', 0);
INSERT INTO `food_knowledge` VALUES (41, '为什么减肥时推荐食用全谷物而不是精制谷物？', '全谷物和精制谷物的热量相同。', '全谷物含有更多的纤维和营养素，有助于提高饱腹感，并且对血糖的影响较小。', 0);
INSERT INTO `food_knowledge` VALUES (42, '为什么减肥时推荐食用低脂肪乳制品？', '低脂肪乳制品含有的脂肪会促进体重增加。', '低脂肪乳制品含有的蛋白质和钙可以帮助减少脂肪吸收，并且有助于控制体重。', 1);
INSERT INTO `food_knowledge` VALUES (43, '为什么减肥时推荐多摄入绿色蔬菜？', '绿色蔬菜含有的碳水化合物会促进体重增加。', '绿色蔬菜热量低，营养丰富，富含纤维，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (44, '为什么减肥时推荐适量摄入健康脂肪？', '所有脂肪都会导致体重增加。', '健康脂肪，如欧米伽-3脂肪酸，对心脏健康有益，并且有助于调节身体功能。', 1);
INSERT INTO `food_knowledge` VALUES (45, '为什么减肥时推荐进行间歇性禁食？', '间歇性禁食会导致营养不良。', '间歇性禁食可以帮助控制热量摄入，并且可能有助于某些人的体重管理。', 1);
INSERT INTO `food_knowledge` VALUES (46, '为什么减肥时推荐充足睡眠？', '睡眠不足可以加速新陈代谢。', '充足的睡眠有助于调节控制食欲的激素，并且有助于恢复肌肉和身体功能。', 1);
INSERT INTO `food_knowledge` VALUES (47, '为什么减肥时推荐减少加工食品的摄入？', '加工食品含有的蛋白质有助于增肌。', '加工食品通常含有高量的糖、盐和不健康的脂肪，对减肥不利。', 1);
INSERT INTO `food_knowledge` VALUES (48, '为什么减肥时推荐食用坚果作为零食？', '坚果含有高脂肪，会导致体重增加。', '坚果虽然含有较高脂肪，但这些脂肪是健康的，并且坚果含有蛋白质和纤维，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (49, '为什么减肥时推荐避免久坐？', '久坐只会减少热量消耗，对减肥影响不大。', '久坐与多种慢性疾病有关，并且可能影响新陈代谢，增加体重。', 1);
INSERT INTO `food_knowledge` VALUES (50, '为什么减肥时推荐食用水果而不是果汁？', '果汁和整个水果的热量相同。', '整个水果含有更多的纤维，有助于提高饱腹感，而果汁缺乏纤维，并且可能含有添加糖。', 1);
INSERT INTO `food_knowledge` VALUES (51, '为什么减肥期间建议分多餐进食？', '因为多餐会增加消化的负担。', '分多餐进食有助于提高代谢率，避免过度饥饿导致的暴饮暴食。', 1);
INSERT INTO `food_knowledge` VALUES (52, '为什么减肥时不应该完全排除任何一种食物类别？', '完全排除可以减少热量摄入。', '营养均衡对健康至关重要，完全排除任何食物类别可能导致营养不良。', 1);
INSERT INTO `food_knowledge` VALUES (53, '为什么减肥时推荐食用豆类食品？', '豆类含有高热量。', '豆类富含蛋白质和纤维，有助于提高饱腹感，同时低热量。', 1);
INSERT INTO `food_knowledge` VALUES (54, '为什么减肥时推荐食用鸡蛋？', '鸡蛋含有高胆固醇。', '鸡蛋是高蛋白、低热量的食物，有助于肌肉修复和增长。', 0);
INSERT INTO `food_knowledge` VALUES (55, '为什么减肥时推荐食用牛油果？', '牛油果含有高脂肪。', '牛油果含有健康的单不饱和脂肪，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (56, '为什么减肥时推荐食用粗粮而不是精粮？', '粗粮比精粮更易消化。', '粗粮含有更多的纤维和营养素，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (57, '为什么减肥时推荐食用低脂或无脂的乳制品？', '乳制品中的脂肪会增加体重。', '选择低脂或无脂的乳制品可以减少饱和脂肪的摄入，同时保持钙和蛋白质的摄入。', 1);
INSERT INTO `food_knowledge` VALUES (58, '为什么减肥时推荐食用富含Omega-3的食物？', 'Omega-3会增加热量摄入。', 'Omega-3对心脏健康有益，并且有助于减少炎症，促进减肥。', 0);
INSERT INTO `food_knowledge` VALUES (59, '为什么减肥时推荐饮用绿茶？', '绿茶含有咖啡因，会影响睡眠。', '绿茶中的儿茶素和咖啡因可以提高代谢率，并且有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (60, '为什么减肥时推荐食用樱桃？', '樱桃含有较高的糖分。', '樱桃含有抗氧化剂，并且其糖分相对较低，有助于控制血糖水平。', 0);
INSERT INTO `food_knowledge` VALUES (61, '为什么减肥时推荐食用鲑鱼？', '鲑鱼含有较多的热量。', '鲑鱼富含Omega-3脂肪酸和蛋白质，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (62, '为什么减肥时推荐食用蓝莓？', '蓝莓含有较多的糖分。', '蓝莓含有抗氧化剂，并且糖分和热量相对较低，有助于控制体重。', 0);
INSERT INTO `food_knowledge` VALUES (63, '为什么减肥时推荐食用全蛋而不是只吃蛋白？', '蛋黄含有较高的脂肪和胆固醇。', '蛋黄中的脂肪是健康的，并且含有重要的营养素，如维生素D和B12。', 0);
INSERT INTO `food_knowledge` VALUES (64, '为什么减肥时推荐食用红薯而不是普通土豆？', '红薯含有较多的碳水化合物。', '红薯虽然碳水化合物含量较高，但同时含有更多的纤维和营养素，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (65, '为什么减肥时推荐食用黑巧克力而不是牛奶巧克力？', '黑巧克力含有较多的糖分。', '黑巧克力含有较少的糖分和更多的抗氧化剂，有助于控制食欲。', 1);
INSERT INTO `food_knowledge` VALUES (66, '为什么减肥时推荐食用瘦鸡肉而不是带皮鸡肉？', '瘦鸡肉和带皮鸡肉的热量相同。', '瘦鸡肉含有较少的脂肪和更多的蛋白质，有助于控制体重。', 1);
INSERT INTO `food_knowledge` VALUES (67, '为什么减肥时推荐食用橄榄油而不是黄油？', '橄榄油含有较高的热量。', '橄榄油含有健康的单不饱和脂肪，有助于提高饱腹感。', 1);
INSERT INTO `food_knowledge` VALUES (68, '为什么减肥时推荐食用草莓而不是其他水果？', '草莓的热量较高。', '草莓含有较低的热量和糖分，同时富含抗氧化剂，有助于减肥。', 0);
INSERT INTO `food_knowledge` VALUES (69, '为什么减肥时推荐食用藜麦而不是白米？', '藜麦的热量比白米高。', '藜麦是完全蛋白，含有更多的纤维和营养素，有助于提高饱腹感。', 0);
INSERT INTO `food_knowledge` VALUES (70, '为什么减肥时推荐食用脱脂希腊酸奶而不是常规酸奶？', '脱脂希腊酸奶的口感较差。', '脱脂希腊酸奶含有更多的蛋白质和较少的脂肪，有助于肌肉修复和控制体重。', 0);
INSERT INTO `food_knowledge` VALUES (71, '为什么减肥时推荐食用坚果而不是薯片？', '坚果含有较高的脂肪。', '尽管坚果含有较高脂肪，但这些脂肪是健康的，并且坚果的蛋白质和纤维有助于提高饱腹感。', 0);
